import React from 'react';
import TextField from '@mui/material/TextField';
import { styled } from '@mui/material/styles';

const CustomTextBox = styled(TextField)({
  '& .MuiInputBase-input': {
    width: '80px', // Set the width of the input field
    height: '50px', // Set the height of the input field
  },
});

const MyTextBox = () => {
  return (
    <CustomTextBox
      fullWidth
      label="Enter Text"
      variant="outlined"
      InputProps={{
        style: {
          color: 'white',
          borderColor: 'white',
        },
      }}
    />
  );
};

export default MyTextBox;
